import styled from 'styled-components';
import Layout from 'components/Layout';

const QandAWrapper = styled(Layout)`
  .subTitle {
    margin-bottom: 1.6rem;
  }
  .customAccordion {
    margin: 0 0 1.6rem 0;
  }
`;

export default QandAWrapper;
